import { getYear } from '../utilities/utilities';

const Footer = () => (
    <footer>
        <a href="https://github.com/jihye-uxui" rel="noreferrer">GitHub</a>
        <a href="https://www.linkedin.com/in/jihye-choe-uxui/" target="_blank" rel="noreferrer">LinkedIn</a>
        <a href="https://codepen.io/JihyeChoe" target="_blank" rel="noreferrer">CodePen</a>
        <a href="https://dribbble.com/Jihye-design/about" target="_blank" rel="noreferrer">Dribbble</a>
        <p>&copy; {getYear()} Jihye Choe.</p>
    </footer>
);

export default Footer;
